import re
import types
from IPython.utils.dir2 import dir2
def dict_dir(obj):
    """Produce a dictionary of an object's attributes. Builds on dir2 by
    checking that a getattr() call actually succeeds."""
    ns = {}
    for key in dir2(obj):
        try:
            ns[key] = getattr(obj, key)
        except AttributeError:
            pass
    return ns
